import React from 'react';
import ArtistsCard from "./ArtistsCard";
import { useState } from 'react';
import { Link } from 'react-router-dom';



import ArtistsCardStaticOne from './ArtistsCardStaticOne';


function Artists(props) {

    const [artistsData, setArtistsData] = useState({
        "Artists": [
          {
            "genreId": "1",
            "name": "GenreName",
            "popularArtists": ["Artists 1 id", "Artists 2 id", "Artists 3 id"],
            "upcomingEvents": ["Event 1 id", "Event 2 id", "Event 3 id", "Event 4 id"],
            "topSongs": ["Song 1", "Song 2", "Song 3"],
            "eventsPriceRange": [0, 0]
          },
          {
            "genreId": "2",
            "name": "GenreName 2",
            "popularArtists": ["Artists 1 ID", "Artists 2 ID", "Artists 3 ID"],
            "upcomingEvents": ["Event 1 ID", "Event 2 ID", "Event 3", "Event 4 ID"],
            "topSongs": ["Song 1", "Song 2", "Song 3"],
            "eventsPriceRange": [0, 0]
          }
        ]
      });

    return (
        <>

        <h1 class = " m-5">Artists</h1>

            <div class="row g-5 m-5" >

                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >
                <div class="col-xl-3 " >
                    <ArtistsCard > </ArtistsCard>
                </div >

                <Link to={`/artists/artistspage/staticinstance1`}><h5><b>Page</b></h5></Link>
                <Link to={`/artists/artistspage/:artistsId`}><h5><b>Page</b></h5></Link>

            </div>




            {/* static dont' use */}

            {/* <div class="row g-5 m-2 " >
                <h1>Artists</h1>

                <div class="col-xl-3 h-25" >
